Release Information: It is the year 2938. The long wished-for encounter of the X Universe and the Earth holds both joy and sorrow for the people. Despite flourishing trade, the clash of the diverse races, cultures and life forms creates new tensions, mistrust and open conflict that need to be overcome! Experience the brilliant climax of the legendary X-Trilogy , and take your place in the history of the X Universe. Largest X Universe ever. New faction: the Terrans %u2013 inhabitants of the Earth. More jobs and non-linear missions than ever before. More than 100 new spaceships, new ship classes and weapon systems. Re-designed user interface for comfortable control by mouse, keyboard and joystick. New group management tool. Large battleships can be boarded by an outside team.
